import ItemListContainer from "./itemListContainer";

const NavBar = () => {

    return (
        
            <header>
                <div className="containerBrand">
               
                </div>

                <nav className="containerItemList">
                <ItemListContainer
                itemUno = "cosa1"
                itemDos = "cosa2"
                itemTres = "cosa4"
                itemCuatro = "cosa5"


                />
                </nav>

                <div className="containerCart">
                </div>

            </header>
    )
}

export default NavBar;
